import React from "react"
import {getUsernameByEmail} from "./../api"




function Home() {
    const email:any = localStorage.getItem('email')
    let username:string = "";
    

    (async () => {
        username = await getUsernameByEmail(email)
    })();
    
    return (
      <div className="Home">
        <h1>Welcome home {username}</h1>
      </div>
    );
  }
  
  export default Home;
